text:
Квартира с действующим бизнесом поделена на 4 части (2-х комнатная квартира, магазин, склад, подвальные помещения) : 
- 1-я часть действующий продуктовый магазин с Отдельной входной группой (площадь 40, 5м² с собственной уборной, в настоящее время сдаётся в аренду за 200 000 тенге в мес. ) ; 
- 2-я часть - 2х комнатная квартира с 2мя входными группами с кухней и 2 санузлами (требуют косметического ремонта). Удобна как для проживания, так и для ведения любого бизнеса, особенно - салон красоты.1 комната площадью 36, 5м² с Отдельной входной группой; 
- 3-я часть - склад с отдельным входом под магазином площадью 12м²; 
- 4-я часть - подвал с 3-комнатами (вход со склада, осуществлены подготовительные работы для прокладки входа с квартиры). 

Удобно как под многофункциональное коммерческое помещение (салон красоты, аптека, бар, общепит, кафе и т.п. ), так и жилье с собственным магазином. 

Требует небольших вложениях, после которых, получится "конфетка" на свой вкус и цвет под любые цели. 

Цена значительно снижена и гораздо ниже рыночной.

Малоквартирный клубный дом бизнес класса Alma Tau Residence от Amanat Group. 
3 комнатная квартира с видом на горы и на город. 
Элитный и экологический чистый район; 
Панорамное остекление; 
Подземный паркинг; 
Грузо-пассажирский лифт.
